import React from 'react'
import Avatar from '@mui/material/Avatar';
import "./header.css";
import Navbar from './home/Navbar';

const Header = () => {
  return (
    <>
        <header>
            <nav>
                <h1>Personal Trainer Web</h1>
                <div className='avatar'>
                <Avatar style={{background: "pink"}}>R</Avatar>
                </div>
            </nav>
        </header>
        <Navbar />
    </>
  )
}

export default Header
